import React from "react";
import { useNavigate } from "react-router-dom";
import "./rec.css";
const Reccomendations = () => {
  const navigate = useNavigate();
  return (
    <div className="recP">
      <div className="weekly">
        weekly
        <br />
        <button
          onClick={() => {
            navigate("/surah", { state: { surah: "Al-Kahf", number: 18 } });
          }}
          className="kB"
        >
          Kahf
        </button>
      </div>
      <div className="daily">
        <span>Daily</span>
        <br />
        <button
          className="kA"
          onClick={() => {
            navigate("/AyahPage", {
              state: { ayahNum: 262, desc: "Ayatul Kursi" },
            });
          }}
        >
          Kursi
        </button>

        <br />
        <button
          onClick={() => {
            navigate("/surah", { state: { surah: "Al-Ikhlas", number: 112 } });
          }}
          className="iS"
        >
          Al Ikhlas
        </button>
        <br />
        <button
          onClick={() => {
            navigate("/surah", { state: { surah: "Al-Falaq", number: 113 } });
          }}
          className="fS"
        >
          Al Falaq
        </button>
        <br />
        <button
          onClick={() => {
            navigate("/surah", { state: { surah: "Al-Naas", number: 114 } });
          }}
          className="nS"
        >
          Al Naas
        </button>
        <br />
        <button
          onClick={() => {
            navigate("/surah", { state: { surah: "Al-Mulk", number: 67 } });
          }}
          className="mS"
        >
          Al Mulk
        </button>
        <br />
        <button
          onClick={() => {
            navigate("/surah", { state: { surah: "Al-Kafirun", number: 109 } });
          }}
          className="kS"
        >
          Al Kafirun
        </button>
        <br />
        <button
          onClick={() => {
            navigate("/surah", { state: { surah: "Al-Waqi’ah", number: 56 } });
          }}
          className="kS"
        >
          Al Mulk
        </button>
      </div>
    </div>
  );
};

export default Reccomendations;
